values:
Well&nbsp; hello again. I was googling up rikku sadaichi and came across this journal. Holy fucking lord it's been with me forever, needs to be updated. Of course, like most people I have transfered to myspace, but this one can be kept up with too, why not?&nbsp; Well,&nbsp; I have a daughter too. Her name is Eternity Dawn. My son is two Nathaniel Wayne. I no longer have custody of Nathan, my&nbsp; mom took him and wont give him back. I have a $183.00 child support payment now. I don't&nbsp;mind really.&nbsp; She took him because my sorry ex "fiance" their father started beating me then&nbsp; decided they needed the same treatment. Needless to say, I left him. Finally. Three months ago.&nbsp;Don't know what the hell I was thinking, I really don't. That bastard fucked me up in so many ways.&nbsp;

Right now I'm looking for a job, considering he&nbsp;screwed me on my highschool diploma. I need money so I can get a GED and be on with my life. God, look where I was. Oppurtunites everywhere... and I was in a hurry to grow up. Why?&nbsp; Why was I so stupid? Then I got taken advantage of. And my life is pretty well set now. I'm getting a job, raising my kid, and getting married. Average American life. My boyfriend's name is Jon. He has two kids as well. He's a self employed mechanic, wonderful man.&nbsp;

I live with Stacey and Wayne. They are my parents age and decided to take me in after knowing my daughter and finding out what Colt put me through. They decided I needed help, so they are my guardian angels. I owe them my life. I just recently called my Dad and am attempting to create a relationship with him again. Hadn;t talked to my brothers in five years, I called on Matt's birthday and we talked. That was weird.&nbsp;

I still enjoy drawing and am currently trying to find a Tatoo parlor to apprentice at or a place to start doing prep work for cars or bikes to get painted. I tried going back to school then I got slammed with child support so I need to get back to work. Hm. I think that is it for now, if I Think of somthing else I'll let you know.

Well now. Heh... 

I had that banquet on Saturday. It went rather well. I won three trophies. yay. I got new makeup and a new dress. Rather cute. Yeah um. I will turn on my web cam and and look all pretty in it tomarrow. Not today because Stacie's day off and I'm not wearing the dress. 

Still a pretty decent weekand other than being in the ER on Friday cuz my mom's temp got a little too high and I told her to call Jose to take her there. She's okay though. She did get me sick on the other hand. It's strep. vV'; 

Gonna have fun this weekand calling peoples. This last weekand got a call from Manuel and called Jeph. I was happy Manuel called surprised me though. But he was grounded from the phone cuz he keeps killing it by calling too much =/. But he was worried. But it's all good. =D. and called Jeph once but Jose was a complete ass and wouldn't turn down his god damn music so I called back again yesterday and talked for around three hours and thirty minutes... longest conversation I've ever held on the phone O.o'; Basicly an hour of it was me saying no no no no no no no and him going please please please please please. Yeah.. --'; 

Today and tomarrow of school left. That's all =D!!! Tomarrow I also get this little ugh pallet stretcher thing a mabober off my mouth.  hehe. Happy.

Thank you all for your support and stuff when I end up being all like the last entry i made. Thanks Becca I will remember to talk to you if I end up being all crazy like that again Oo';. Okie day I'm off now. Later.
